import{_ as e,o as n,c as i,a}from"./app.2c21d357.js";var r="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/00.jpg",t="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/01.jpg",s="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/02.jpg",h="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/03.jpg",d="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/04.jpg",u="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/05.jpg",m="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/06.jpg",l="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/07.jpg",c="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/08.jpg",g="/aktivitaeten/SOTA-im-Sauerland-2024-06-25/09.jpg";const o={},p=a('<h1 id="sota-im-sauerland" tabindex="-1"><a class="header-anchor" href="#sota-im-sauerland" aria-hidden="true">#</a> SOTA im Sauerland</h1><p>In der vergangenen Woche deutete sich an, dass ich am 25.06.24 einmal einen freien Tag habe. Die Familie ist in der Woche immer ziemlich besch\xE4ftigt, so dass ich bei der guten Wettervorhersage mal wieder zu einer SOTA-Aktivierung ins Sauerland aufbrechen konnte. Die SOTA-Aktivierer aus den Alpen werden \xFCber die meisten Spots in den Mittelgebirgen mit ihren geringen H\xF6hen und kurzen Aufstiegen wahrscheinlich nur schmunzeln, aber immerhin haben wir in NRW SOTA-Gipfel in erreichbarer N\xE4he. Ich pers\xF6nlich finde SOTA eine sch\xF6ne Erg\xE4nzung zu POTA, da ich hier durch den h\xF6heren Wanderanteil und die deutlich h\xF6here Abgeschiedenheit nochmal eine ganz andere Naturerfahrung genie\xDFen kann.</p><h2 id="molmert-dm-nw-223" tabindex="-1"><a class="header-anchor" href="#molmert-dm-nw-223" aria-hidden="true">#</a> Molmert DM/NW-223</h2><p>Morgens um 08:00 Uhr ging es direkt mit dem Auto nach Plettenberg. Der Xiegu G90 mit der DF-Groundplane und einem 6Ah-Eremiten lagen im Rucksack im Kofferraum. Dazu ein paar kleinere Snacks und bei der Wettervorhersage durften 2 Liter Wasser auch nicht fehlen. Der erste Stop war der Vorort Bremcke, welcher ca. 5 km westlich von Plettenberg liegt. Den Wagen abgestellt und um 09:45 mit dem Aufstieg zum hohen Molmert (DM/NW-223) begonnen. Insgesamt hatte der Aufstieg ca. 250hm und ist damit im mittleren Bereich im Sauerland. Nach 45 Min war der Gipfel erreicht. Hier gab es zum Gl\xFCck einen kleinen Pfad, so dass ich mich nicht durch Unterholz schlagen musste. Schnell die Groundplane aufgebaut. Leider gab nur eine d\xFCnne Erdschicht \xFCber Felsen, so musste ich zweimal die Antenne neu aufrichten. Mit mehr Wind w\xE4re das noch spannend geworden. Die Sonne schien schon ziemlich intensiv bei einem wolkenlosen Himmel. Ich hab nur 20m gearbeitet, da die Bandbedingungen f\xFCr die anderen B\xE4nder ziemlich bescheiden aussahen. Nach Setzen des Spots gab es sofort ein gr\xF6\xDFeres Pileup und in 20 Min kamen direkt 20 QSOs ins Log. Nach Abarbeiten des Pileups habe ich direkt wieder abgebaut und bin zum Ausgangspunkt zur\xFCck. Den zweiten Aufstieg wollte ich wegen der steigenden Temperaturen gerne schnell hinter mich bringen.</p><p><img src="'+r+'" alt="00"><img src="'+t+'" alt="01"><img src="'+s+'" alt="02"><img src="'+h+'" alt="03"></p><h2 id="heiligenstuhl-dm-nw-219" tabindex="-1"><a class="header-anchor" href="#heiligenstuhl-dm-nw-219" aria-hidden="true">#</a> Heiligenstuhl DM/NW-219</h2><p>Mit dem Wagen ging es zum zweiten Stop nach Landemert (ca. 5km s\xFCdlich von Plettenberg). Hier beginnt der Aufstieg zum Heiligenstuhl (DM/NW-219). Der Aufstieg ist mit 150hm nicht ganz so hoch, was bei den steigenden Temperaturen sch\xF6n ganz angenehm war. Das Thermometer zeigte mittlerweile 25 Grad und der Gipfel ist nicht bewaldet. Leider gab es auf den letzten 60hm keinen Weg mehr. Die R\xFCckegasse, welche auf der Karte eingezeichnet ist, war schon ziemlich zugewachsen. Mit dem Rucksack ging es dann direkt durch das Unterholz und einige liegende B\xE4ume aus vergangenen Sturmsch\xE4den musste ich umlaufen oder \xFCberklettern. Oben hab ich wieder schnell die Groundplane aufgestellt, der Untergrund war deutlich besser und die Antenne blieb die ganze Zeit stehen. Nach setzen den Spots auf 20m kam es sofort wieder zu einem gr\xF6\xDFeren Pileup und einige Bekannte der ersten Aktivierung kamen wieder ins Log. Zus\xE4tzlich hatte ich noch ein S2S-QSO zu G/TW-004. Nach dem Pileup nochmal schnell die Groundplane mit der Spule auf 40m umgebaut. Trotz Spot und l\xE4ngerem CQ-Ruf konnte ich auf 40m nur ein QSO fahren. Nach 30 Min hab ich oben wieder abgebaut, da mittlerweile auch das Wasser aufgebraucht war und ohne Schatten war es auf dem Gipfel auch ziemlich hei\xDF. Nach 45 Min. Abstieg durchs Unterholz und \xFCber Wirtschaftswege wieder am Auto angekommen.</p><p>Insgesamt war das mal wieder ein erfolgreicher SOTA-Tag mit 2 Aktivierungen. Beides waren \u201Enur\u201C 4 Punkte Gipfel, aber f\xFCr mich Uniques. Die musste ich einfach mal abhaken. Dar\xFCber hinaus konnte ich die Logs auch f\xFCr den Park DE-0054 hochladen, so dass ich ohne die Doppelten den Park \u201ESauerland- Rothaargebirge\u201C mit 30 QSOs ebenfalls aktivieren konnte.</p><p><img src="'+d+'" alt="04"><img src="'+u+'" alt="05"><img src="'+m+'" alt="06"><img src="'+l+'" alt="07"><img src="'+c+'" alt="08"><img src="'+g+'" alt="09"></p><p>73 DB6NL</p>',10),b=[p];function S(f,k){return n(),i("div",null,b)}var A=e(o,[["render",S],["__file","2024-06-25-SOTA-im-Sauerland.html.vue"]]);export{A as default};
